import React from 'react';
import JobPostList from '../components/JobPosts/JobPostList';

const Jobs = () => {
    return (
        <div className="container mx-auto p-4">
            <h1 className="text-2xl font-bold mb-4">Job Listings</h1>
            <JobPostList />
        </div>
    );
};

export default Jobs;
